import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ListUrlComponent from './components/ListUrlComponent';
import CreateUrlComponent from './components/CreateUrlComponent';
import ViewUrlComponent from './components/ViewUrlComponent';
import UpdateUrlComponent from './components/UpdateUrlComponent';

function App() {
  return (
    <div>
      <Router>
        <div className='container'>
          <Switch>
            <Route path='/' exact component={ListUrlComponent}></Route>
            <Route
              path='/add-url/:short'
              component={CreateUrlComponent}
            ></Route>
            <Route path='/:short' component={ViewUrlComponent}>
              <ViewUrlComponent short='short' />
            </Route>
            <Route path='/:short/edit' component={UpdateUrlComponent}></Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
